TEXT_FESBKCRECOMPLETE_00716_YESNOCHECK_000_002<tab>Bei der Nutzung der Funktion „Saisonalen Auftrag wiederholen“ werden die folgenden Aufträge zurückgesetzt:

　　- <var 28 ((Quest)) E80201 /var>
<var 08 E4E80301 (()) ((　　- <var 28 ((Quest)) E80301 /var>
)) /var><var 08 E4E80401 (()) ((　　- <var 28 ((Quest)) E80401 /var>
)) /var><var 08 E4E80501 (()) ((
Bis die Aufträge erneut erfüllt wurden, ist es nicht möglich, mit den folgenden NPCs zu handeln:

　　- <var 2B ((<var 28 ((ENpcResident)) E80501 /var>)) /var>
)) /var><var 08 E4E80601 (()) ((　　- <var 2B ((<var 28 ((ENpcResident)) E80601 /var>)) /var>
)) /var><var 08 E4E80501 (()) ((
Wenn bis zum Ende der Dauer des saisonalen Ereignisses die Aufträge nicht abgeschlossen werden, bleibt der Handel mit diesen NPCs weiterhin verwehrt.
)) /var>
Bitte stelle sicher, dass dir während des saisonalen Ereignisses ausreichend Zeit zur Verfügung steht, um den saisonalen Auftrag abzuschließen.

Viel Spaß dabei!
